import styled from "styled-components";

export const StyledPokeDex = styled.div`
  max-width: 600px;
  margin: 15px auto;
  padding: 0 20px;
  min-height: 82vh;
  background-color: #ffeecb;

  div {
    background-color: white;
    height: 200px;
    width: 100%;
  }
`;
